            "data": "<p><b>Dr. D. Y. Patil Institute of Technology,</b> Pimpri, Pune, was founded in July 1998 as Dr. D. Y. Patil Women's College of Engineering. Dr. D. Y. Patil, former Governor of Bihar State in the Republic of India, is honored with the college's name. In the academic year 20022003, the institution was changed into a co-educational college known as Dr. D. Y. Patil Institute of Engineering & Technology, Pimpri, Pune. </p><p>Dr. D. Y. Patil Institute of Technology is located near the Pimpri-Chinchwad industrial zone, which is one of Asia's largest industrial belts. Savitribai Phule Pune University is affiliated with the college. In 2021, the National Institute of Ranking Framework (NIRF) ranked 172 in the engineering sector.</p><p>Dr. D. Y. Patil Institute of Technology in Pune features well-equipped laboratories with the latest technology, as well as highly skilled teaching professionals in all disciplines. Apart from formal teaching, the Central Library is equipped with reference volumes, textbooks, national and international magazines, and wireless internet. The College is an Indo-US Collaboration in Engineering Education (IUCEE) and International Federation for Engineering Education consortium member (IFEES).</p>"
